      <text id="108" justification="0" size="4" underlined="false">
        <text>To view a forum entry from BrowseActivity call the controller
function viewForumEntry. This function should use an intent to 
start the QuestionActivity and send it the data for that forum entry.
the QuestionActivity should then use its controller to add the forum
entry to the model. The model will then call the update method on the 
view. The view will now display the ForumEntry
</text>
      </text>

      <textColor reference="115"/>
      <text id="116" justification="0" size="4" underlined="false">
        <text>Assume that changes are constantly being saved. This means, if you use the BrowseController
to sortBySearchTerm() then assume that locally saved data is sorted this way. ie, if you use 
DataManager.loadLocallySaved() then the ArrayList you get is sorted by search terms. In addition
assume if you use DataManager.load() that the resulting ArrayList is sorted as such.</text>
      </text>
